(function($) {
    var ipc = require('ipc');
    var vkapi = VKFC.vkapi;
    var login = {};
    VKFC.login = login;

    $('.logout').on('click', function() {
        VKFC.login.logout();
    });

    login.logout = function() {
        $('.loader-wrapper').show();
        $('.wrapper').hide();

        $.ajax({
            url: 'https://login.vk.com/?act=openapi&oauth=1&aid='+VKFC.config.appId+'&location=artanik.ru&do_logout=1&token='+VKFC.vkapi.token,
            //url: 'https://oauth.vk.com/logout?client_id='+VKFC.vkapi.token,
            //url: 'https://oauth.vk.com/logout',
            method: 'get',
            success: function() {
                ipc.send('dropData');
                ipc.send('dropVideos');
                ipc.send('dropPhotos');
                localStorage.removeItem('access_token');
                window.location.href = 'login.html';
            }
        });
    };

    login.init = function() {
        var $webview = $('#webview');
        $('.loader-wrapper').hide();
        $('.wrapper').show();

        $webview.attr('src', vkapi.getAuthUrl());

        $webview[0].addEventListener("did-get-redirect-request", function (e) {
            var parser = document.createElement('a');
            parser.href = e.newUrl;
            var hash = parser.hash.split('=');
            var query = parser.search;
            var code = hash[1];

            if(query.indexOf('error') !== -1) {
                $(webview).remove();
            }

            if(hash[0] === '#code') {
                $(webview).remove();
                $('.loader-wrapper').show();
                $('.wrapper').hide();
                vkapi.getToken(code, function(response) {
                    var token = response.access_token;
                    localStorage.setItem('access_token', token);
                    VKFC.load();
                });
            }

        });

        $('.singup-btn').on('click', function() {
            $('#webview-wrapper').show();
        });


        $('.version').text('v'+ipc.sendSync('getVersion'));
        
    };

})(jQuery);
(function($) {
    var ipc = require('ipc');
    var vkapi = VKFC.vkapi;
    var db = VKFC.db;
    var pathname = window.location.pathname;
    var _token = localStorage.getItem('access_token');

    VKFC.load = function() {
        var _token = localStorage.getItem('access_token');
        var sync = {
            posts: false,
            photos: false,
            videos: false
        };
        
        var _reload = function() {
            if(sync.posts === 'done' && sync.photos === 'done' && sync.videos === 'done') {
                window.location.reload();
            }
        };

        if(!ipc.sendSync('checkData')) {
            $('.loader .title').html('Синхронизация');
            $('.loader .sub-title__loader').removeClass('hide');

            vkapi.setToken(_token);
            db.setPosts();
            db.setPhotos();
            db.setVideos();

            ipc.on('setData', function(arg) {
                sync.posts = arg;
                _reload();
            });

            ipc.on('setPhotos', function(arg) {
                sync.photos = arg;
                _reload();
            });

            ipc.on('setVideos', function(arg) {
                sync.videos = arg;
                _reload();
            });
        }
    };

    // disabled pinch zoom
    document.body.addEventListener('mousewheel', function(e) {
        if(e.ctrlKey) {
            e.preventDefault();
        }
    });

    if(_.isEmpty(_token)) {
        VKFC.login.init();
    } else if(!ipc.sendSync('checkData')) {
        VKFC.load();
    } else {
        if(pathname.indexOf('login.html') !== -1) {
            window.location.href = 'index.html';
        }
        $('.loader-wrapper').show();
        $('.wrapper').hide();

        vkapi.setToken(_token);
        db.init();
        VKFC.dashboard.init();

        $(window).on('load', function() {
            $('.loader-wrapper').hide();
            $('.wrapper').show();
        });
    }
})(jQuery);